import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonMenu, IonList, IonItem } from '@ionic/react';
import React from 'react';

//Page components
import LogIn from '../components/LogIn';
import './Home.css';


class Home extends React.Component {

  render() {

    return (
      <IonPage>

        <IonContent id="content">


        <IonMenu side="start" menuId="first" content-id="content">
        <IonHeader>
          <IonToolbar color="primary">
            <IonTitle>Start Menu</IonTitle>
          </IonToolbar>
        </IonHeader>
        <IonContent>
          <IonList>
            <IonItem>Menu Item</IonItem>
            <IonItem>Menu Item</IonItem>
            <IonItem>Menu Item</IonItem>
            <IonItem>Menu Item</IonItem>
            <IonItem>Menu Item</IonItem>
          </IonList>
        </IonContent>
      </IonMenu>
        </IonContent>

          <IonHeader>
              <IonToolbar color="primary">
                <IonTitle id="page-title">UMFit</IonTitle>
              </IonToolbar>
          </IonHeader>
      <IonContent class="background-image"></IonContent>
      <LogIn />
      </IonPage>
    );
  }

};

export default Home;
